import React, { useState } from 'react';
import { Menu, X, Home, UserPlus, LogIn, Users, Calendar, Activity } from 'lucide-react';

// Mock NavLink component for demonstration
const NavLink = ({ to, children, className, ...props }) => {
  const [isActive, setIsActive] = useState(to === '/');
  
  const handleClick = (e) => {
    e.preventDefault();
    setIsActive(true);
    // Reset other active states (simplified for demo)
    setTimeout(() => setIsActive(false), 2000);
  };
  
  return (
    <a 
      href={to} 
      onClick={handleClick}
      className={typeof className === 'function' ? className({ isActive }) : className}
      {...props}
    >
      {children}
    </a>
  );
};

function NavMenu() {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const navItems = [
    { to: '/', label: 'Home', icon: Home },
    { to: '/register', label: 'Register', icon: UserPlus },
    { to: '/login', label: 'Login', icon: LogIn },
    { to: '/patients', label: 'Patients', icon: Users },
    { to: '/appointments', label: 'Appointments', icon: Calendar },
    { to: '/healthstats', label: 'Health Stats', icon: Activity }
  ];

  return (
    <nav className="nav-container">
      <div className="nav-wrapper">
        {/* Logo/Brand */}
        <div className="nav-brand">
          <div className="brand-icon">
            <Activity className="w-8 h-8" />
          </div>
          <h1 className="brand-text">CTRL</h1>
        </div>

        {/* Desktop Navigation */}
        <ul className="nav-list desktop-nav">
          {navItems.map((item) => {
            const IconComponent = item.icon;
            return (
              <li key={item.to}>
                <NavLink 
                  to={item.to} 
                  className={({ isActive }) => 
                    `nav-link ${isActive ? 'active' : ''}`
                  }
                >
                  <IconComponent className="nav-icon" />
                  <span>{item.label}</span>
                </NavLink>
              </li>
            );
          })}
        </ul>

        {/* Mobile Menu Button */}
        <button 
          className="mobile-menu-btn"
          onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
        >
          {isMobileMenuOpen ? <X className="w-6 h-6" /> : <Menu className="w-6 h-6" />}
        </button>

        {/* Mobile Navigation */}
        <div className={`mobile-nav ${isMobileMenuOpen ? 'open' : ''}`}>
          <ul className="nav-list mobile-nav-list">
            {navItems.map((item) => {
              const IconComponent = item.icon;
              return (
                <li key={item.to}>
                  <NavLink 
                    to={item.to} 
                    className={({ isActive }) => 
                      `nav-link mobile-nav-link ${isActive ? 'active' : ''}`
                    }
                    onClick={() => setIsMobileMenuOpen(false)}
                  >
                    <IconComponent className="nav-icon" />
                    <span>{item.label}</span>
                  </NavLink>
                </li>
              );
            })}
          </ul>
        </div>
      </div>

      <style jsx>{`
        .nav-container {
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          backdrop-filter: blur(10px);
          border-bottom: 1px solid rgba(255, 255, 255, 0.1);
          position: sticky;
          top: 0;
          z-index: 1000;
          font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
        }

        .nav-wrapper {
          max-width: 1200px;
          margin: 0 auto;
          padding: 0 20px;
          display: flex;
          align-items: center;
          justify-content: space-between;
          height: 70px;
        }

        .nav-brand {
          display: flex;
          align-items: center;
          gap: 12px;
          color: white;
          font-weight: 700;
        }

        .brand-icon {
          background: rgba(255, 255, 255, 0.2);
          border-radius: 12px;
          padding: 8px;
          backdrop-filter: blur(10px);
        }

        .brand-text {
          font-size: 24px;
          margin: 0;
          letter-spacing: 1px;
        }

        .nav-list {
          display: flex;
          list-style: none;
          margin: 0;
          padding: 0;
          gap: 8px;
        }

        .desktop-nav {
          display: none;
        }

        .nav-link {
          display: flex;
          align-items: center;
          gap: 8px;
          padding: 12px 20px;
          border-radius: 25px;
          color: rgba(255, 255, 255, 0.9);
          text-decoration: none;
          font-weight: 500;
          font-size: 14px;
          transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
          position: relative;
          overflow: hidden;
        }

        .nav-link::before {
          content: '';
          position: absolute;
          top: 0;
          left: -100%;
          width: 100%;
          height: 100%;
          background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.2), transparent);
          transition: left 0.5s;
        }

        .nav-link:hover::before {
          left: 100%;
        }

        .nav-link:hover {
          background: rgba(255, 255, 255, 0.15);
          color: white;
          transform: translateY(-2px);
          box-shadow: 0 8px 25px rgba(0, 0, 0, 0.2);
        }

        .nav-link.active {
          background: rgba(255, 255, 255, 0.25);
          color: white;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.3);
        }

        .nav-icon {
