          transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
        }

        .mobile-nav.open {
          transform: translateY(0);
          opacity: 1;
          visibility: visible;
        }

        .mobile-nav-list {
          flex-direction: column;
          gap: 0;
          padding: 20px;
        }

        .mobile-nav-link {
          width: 100%;
          justify-content: flex-start;
          padding: 16px 20px;
          border-radius: 12px;
          margin-bottom: 8px;
        }

        /* Tablet and Desktop */
        @media (min-width: 768px) {
          .desktop-nav {
            display: flex;
          }

          .mobile-menu-btn {
            display: none;
          }

          .mobile-nav {
            display: none;
          }

          .nav-link {
            font-size: 15px;
          }
        }

        /* Large Desktop */
        @media (min-width: 1024px) {
          .nav-wrapper {
            padding: 0 40px;
          }

          .nav-list {
            gap: 12px;
          }

          .nav-link {
